item.description:
Get instructions for trading.

These set of instructions are currently gated by API keys, [apply for access](https://airtable.com/shrsYtSEJ8M8ESaNq)! Once you get the key, set it in header: `Authorization: Bearer`

Transactions are decentralized in Web3. To trade an NFT on Magic Eden, you are  
essentially send a transaction that interact with Magic Eden accounts to block chain  
directly.

For example, you would like to list an NFT on Magic Eden. You need to

1.  Fetch an instruction by sending a GET request to /v2/instructions/sell with required parameters
2.  Sign with user’s wallet and send the transaction to chain


Here’s an example to ‘buy’ (send an offer) an NFT:

``` javascript
const Web3 = require('@solana/web3.js');
const axios = require('axios');
//PLEASE BE VERY CAREFUL WITH THIS EXAMPLE. 
//IF YOU PUT YOUR SECRET KEY IN THE SECRETKEY VARIABLE 
//YOU WILL MAKE A BID OF 0.01 SOLANA!
//API key
const bearerToken = "Put-Your-API-Key-Here"
// This is not a real secret key and is for illustrative purposes only. 
let secretKey = Uint8Array.from([
    69,115,18,93,278,147,103,165,60,90,
    28,65,156,70,95,3,219,13,242,445,
    246,157,47,89,3,12,72,84,132,151,164,
    150,150,213,148,50,77,183,120,145,43,
    223,112,30,248,22,334,122,83,171,202,40,
    1,91,171,90,33,223,22,84,4,69,103,69]);
let keypair = Web3.Keypair.fromSecretKey(secretKey);
const connection = new Web3.Connection(Web3.clusterApiUrl("mainnet-beta"), "confirmed");
//base58 wallet string to send in as params 
const wallet = keypair.publicKey.toBase58();
// Get buy instruction from API
axios.get(
  'https://api-mainnet.magiceden.dev/v2/instructions/buy', {
    params: {
      buyer: wallet, 
      auctionHouseAddress: 'E8cU1WiRWjanGxmn96ewBgk9vPTcL6AEZ1t6F6fkgUWe',
      tokenMint: '', 
      price: 0.01 
      },
      headers: { Authorization: "Bearer " + bearerToken }
  }).then((res) => {
      // sign and send txn here
      const txSigned = res.data.txSigned
      const txn = Web3.Transaction.from(Buffer.from(txSigned.data))
      const signature = Web3.sendAndConfirmTransaction(
          connection,
          txn,
          [keypair]
      )
  })

```

Then you are done. You can confirm the transaction signature on [Solana Explorer](https://explorer.solana.com/?cluster=devnet).

